import M from '../MetaData/Images/1.png';
import N from '../MetaData/Images/1.png';
import O from '../MetaData/Images/1.png';
import '../css/stylesheet.css';

const NftPage = () => {

    return (
        <div class="ui three column grid">
            <div class="row">
                <div class="column"></div>
                <div class="column">
                    <img src={A} ></img>
                </div>
                <div class="column"></div>
            </div>
            <div class="row">
                <div class="column"></div>
                <div class="column"></div>
                <div class="column"></div>
            </div>
            <div class="row">
                <div class="column"></div>
                <div class="column"></div>
                <div class="column"></div>
            </div>
            <div class="row">
                <div class="column"></div>
                <div class="column"></div>
                <div class="column"></div>
            </div>
            <div class="row">
                <div class="column"></div>
                <div class="column"></div>
                <div class="column"></div>
            </div>
        </div>
    );

}

export default NftPage;
